import {ReviewContainer} from './ReviewSection.elements'



const ReviewSection = () => {
    return (
        <ReviewContainer>
            <div className="App">
            <form className="search-bar">
              <input type="text" className="search-bar"/>
              <button type="submit" className="search-button">
                Search
              </button>
            </form>
          </div>
        </ReviewContainer>
    )
}

export default ReviewSection;
